svg.script:
document.SetBatteryStateOfCharge = function(percent, nom_capacity)
{
	var rect_max_width = 75.0;

	var width = (rect_max_width/100.0)*percent;

	document.getElementById("bat_state_text").innerHTML = String(percent) + " %";

	document.getElementById("bat_state_rect").setAttribute("width", width);

	energy = nom_capacity * percent / 100;
	document.getElementById("bat_energy").innerHTML = String(energy.toFixed(1));
}

document.Animation = function(Power, bubble, invert, MaxPower) 
{
	var DirStr = "";

	switch(bubble)
	{
		case "Home":
			x_dir     = true;
			y_dir     = true;
			bubble_id = "bubble_home_anim";
			text_id   = "pwr_home";
			break;
		case "Battery":
			x_dir     = false;
			y_dir     = false;
			bubble_id = "bubble_bat_anim";
			text_id   = "pwr_bat";
			break;
		case "Solar":
			x_dir     = true;
			y_dir     = false;
			bubble_id = "bubble_solar_anim";
			text_id   = "pwr_solar";
			break;
		case "Grid":
			x_dir     = false;
			y_dir     = true;
			bubble_id = "bubble_grid_anim";
			text_id   = "pwr_grid";
			break;
		default:
			return;
	}

	if( MaxPower == 0 ) // div by zero
		MaxPower = 10000; // 10 kW


	var y = 40;
	var x = y * 1.5;

	if( x_dir == false )
		x = -x;

	if( y_dir == false )
		y = -y;

	if( invert )
		Power = Power * (-1);

	if (Power > 0)
		DirStr = "0, 0; " + x + ", " + y; 
	else if (Power < 0)
		DirStr = x + ", " + y + "; 0, 0"; 
	else
		DirStr = x + ", " + y + "; " + x + ", " + y; 

	TmpPower = Math.abs(Power);
	if( TmpPower > MaxPower )
		TmpPower = MaxPower;
	max_speed = 0.3; // 0.4 s bubble speed
	min_speed = 3.0; // min bubble speed 3 seconds
	speed = (TmpPower/MaxPower) * (max_speed-min_speed) + min_speed;
	speed = String(speed) + "s";

	document.getElementById(bubble_id).setAttribute("values", DirStr);
	document.getElementById(bubble_id).setAttribute("dur", speed);

	document.getElementById(text_id).innerHTML = String(Math.abs(Math.round(Power))) + " W";

}
